import unittest
import time
from remove_repeating_suffix import remove_fuzzy_repeating_suffix


class RemoveRepeatingSuffixTest(unittest.TestCase):
    def test_remove_fuzzy_repeating_suffix(self):
        string_tests = [string_test_1, string_test_2, string_test_3]

        for string_test in string_tests:
            time_start = time.time()
            output, percentage_removed = remove_fuzzy_repeating_suffix(string_test, 0.8)
            time_end = time.time()
            print(f"Time elapsed: {time_end - time_start} seconds")
            self.assertGreaterEqual(0.01, time_end - time_start)

            print(f"Output string: {output}\n\n")

if __name__ == '__main__':
    unittest.main()

